import {initDefaultConfig} from './defaultConfig.js';
import {initCore} from './editorcore.js';
import {getConfig} from './states.js';
import {initSessions} from '@acepad/sessions';
import {getInstance} from "./instance.js";
export async function init(element){
    initDefaultConfig();
    initCore(element);
    const {menus}=getConfig();
    const ins=getInstance();
    initSessions(ins);
    return ins;
}
